        Statistical Datasets by Conquest Systems, Inc. Dataset-ID:  032-002-001\n\nDataset:
        Reports a count of persons obtaining lawful permanent resident status (LPR)
        in the United States in a given year by country of last residence. Data are
        based on information collected as part of the Computer Linked Application
        Information System (CLAIMS) of US Citizenship and Immigration Services, which
        maintains information from the applications for LPR status.\nA lawful permanent
        resident (LPR) or “green card” recipient is defined by immigration law as
        a person who has been granted lawful permanent residence in the United States.
        Permanent resident status confers certain rights and responsibilities. For
        example, LPRs may live and work permanently anywhere in the United States,
        own property, and attend public schools, colleges, and universities. They
        may also join certain branches of the Armed Forces, and apply to become US
        citizens if they meet certain eligibility requirements. This Office of Immigration
        Statistics dataset presents information obtained from applications for LPR
        status on the number and characteristics of persons who became LPRs in the
        United States. Data were obtained from the Computer Linked Application Information
        System (CLAIMS) of the U.S. Citizenship and Immigration Services (USCIS),
        which maintains information from the applications for lawful permanent resident
        status. The DS-230 Application for Immigrant Visa and Alien Registration of
        the Department of State is used by applicants living abroad. The I-485 Application
        to Register Permanent Residence or Adjust Status of USCIS is used by applicants
        living in the United States. This dataset shows LPRs by country of last residence.\nhttp://www.dhs.gov/files/statistics/publications/yearbook.shtm\n\n\nCategory:
